import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/SideBar.css';

const SideBar = () => {
  let navigate = useNavigate();

  const handleLogout = () => {
    // Perform any logout logic here (e.g., clearing local storage, updating state)

    navigate('/'); // Redirect to the login page
  };

  return (
    <div className="sidebar">
      <div className="profile-picture-container">
                <img src="logo192.png" alt="Profile" className="profile-picture" width={120}/>
            </div>
      <nav>
        <ul>
          <li><a href="#profile">Profile</a></li>
          <li><a href="#classroom">Classroom</a></li>
          <li><a href="#new-class">New Class</a></li>
        </ul>
      </nav>

      <div className="logout">
        <button onClick={handleLogout}>Log Out</button> {/* Changed to a button for semantics */}
      </div>
      {/* <div className="logout">
         <a href="#logout">Log Out</a>
      </div> */}
    </div>
  );
};

export default SideBar;
